// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

/**
 * @title MediVaultVerification
 * @dev Handles verification and tracking of medical documents stored on IPFS
 * 
 * Security considerations:
 * - Only trusted backend can add records
 * - File hashes include multiple components to prevent collisions
 * - Patient records are efficiently indexed by their blockchain code
 */
contract MediVaultVerification {
    // Struct to store document metadata with minimal gas usage
    struct DocumentRecord {
        bytes32 fileHash;     // SHA256(encrypted file + CID + uploaderID + timestamp)
        string cid;          // IPFS Content ID
        address uploaderID;  // Address of the uploader (for audit)
        uint256 timestamp;   // Upload timestamp
        bool exists;         // For verification checks
    }

    // Owner of the contract (backend wallet)
    address public immutable owner;

    // Mapping: patientBCCode => array of document records
    mapping(bytes32 => DocumentRecord[]) private patientRecords;
    
    // Mapping: fileHash => bool to quickly verify if a file exists
    mapping(bytes32 => bool) private fileExists;

    // Event emitted when a new file is uploaded
    event FileUploaded(
        bytes32 indexed fileHash,
        string cid,
        address indexed uploaderID,
        bytes32 indexed patientBCCode,
        uint256 timestamp
    );

    // Event emitted when verification is performed
    event FileVerified(
        bytes32 indexed fileHash,
        bytes32 indexed patientBCCode,
        bool authentic,
        uint256 timestamp
    );

    // Modifier to restrict access to owner only
    modifier onlyOwner() {
        require(msg.sender == owner, "MediVault: Caller is not owner");
        _;
    }

    constructor() {
        owner = msg.sender;
    }

    /**
     * @dev Add a new file record to the blockchain
     * @param fileHash SHA256 hash of (encrypted file + CID + uploaderID + timestamp)
     * @param cid IPFS Content ID where the encrypted file is stored
     * @param patientBCCode Unique blockchain code for the patient
     */
    function addFileRecord(
        bytes32 fileHash,
        string calldata cid,
        bytes32 patientBCCode
    ) external onlyOwner {
        require(!fileExists[fileHash], "MediVault: File hash already exists");
        require(bytes(cid).length > 0, "MediVault: CID cannot be empty");

        // Create new record
        DocumentRecord memory newRecord = DocumentRecord({
            fileHash: fileHash,
            cid: cid,
            uploaderID: msg.sender,
            timestamp: block.timestamp,
            exists: true
        });

        // Store record
        patientRecords[patientBCCode].push(newRecord);
        fileExists[fileHash] = true;

        // Emit event
        emit FileUploaded(
            fileHash,
            cid,
            msg.sender,
            patientBCCode,
            block.timestamp
        );
    }

    /**
     * @dev Verify if a file is authentic and unmodified
     * @param fileHash Hash to verify
     * @param patientBCCode Patient's blockchain code
     * @return bool True if file exists and is authentic
     */
    function verifyFile(bytes32 fileHash, bytes32 patientBCCode) 
        external 
        returns (bool)
    {
        bool authentic = fileExists[fileHash];
        
        emit FileVerified(
            fileHash,
            patientBCCode,
            authentic,
            block.timestamp
        );
        
        return authentic;
    }

    /**
     * @dev Get all files for a specific patient
     * @param patientBCCode Patient's blockchain code
     * @return DocumentRecord[] Array of patient's document records
     */
    function getFilesByBCCode(bytes32 patientBCCode)
        external
        view
        returns (DocumentRecord[] memory)
    {
        return patientRecords[patientBCCode];
    }
}

